import { Accordion, AccordionItem, AccordionItemHeading, AccordionItemButton, AccordionItemPanel } from 'react-accessible-accordion';

function Response({questions}) {
    return (
        <Accordion>
        {questions.map((question, index) => (
            <AccordionItem key={index}>
            <AccordionItemHeading>
                <AccordionItemButton>
                {question.question}
                </AccordionItemButton>
            </AccordionItemHeading>
            <AccordionItemPanel>
                <div className="row">
                <div className="col">
                    <h3>{question.person1.title}</h3>
                    <p>{question.person1.text}</p>
                </div>
                <div className="col">
                    <h3>{question.person2.title}</h3>
                    <p>{question.person2.text}</p>
                </div>
                </div>
            </AccordionItemPanel>
            </AccordionItem>
        ))}
        </Accordion>
    );
  }

export default Response;
